const fs = require('fs');
const path = 'share-11' +'.png';
const data = 'data:image/jpeg;base64,'


const base64 = data.replace(/^data:image\/\w+;base64,/,""); //base64data:image/png;base64
// new Buffer v6.0Buffer.from()
const dataBuffer = new Buffer(base64, 'base64'); //base64buffer
fs.writeFile(path, dataBuffer, function(err){//fs
    if(err){
        console.log(err);
    }else{
        console.log('');
    }
})